import React, { Component } from 'react'
import {Link} from 'react-router-dom'

export default class Lefter extends Component {
    render() {
        return (
            <div className='left'>
                <Link to='/shouye'>首页</Link>
                <Link to='/person'>人员管理</Link>
                <Link to='/huati'>话题管理</Link>
                <Link to='/yonghu'>用户管理</Link>
                <Link to='/gonggao'>公告管理</Link>
                <Link to='/file'>文件管理</Link>
                <Link to='/exit'>退出</Link>
            </div>
        )
    }
}
